import React, {Component} from "react";
import Map from 'pigeon-maps';
import Marker from 'pigeon-marker';
import Overlay from 'pigeon-overlay';
import Navbar from "../Components/Navbar";


class PigeonMaps extends Component{
    constructor (props) {
        super(props)

        this.state = {
          zoom: this._lastZoom,
          center: this._lastCenter,
          width: props.width || props.defaultWidth,
          height: props.height || props.defaultHeight,
          zoomDelta: 0,
          pixelDelta: null,
          oldTiles: [],
          defaultWidth: "100%",
          showWarning: false,
          warningType: null
        }
      }

    pixelToLatLng(pixel, center, zoom) {
        console.log(pixel)
        console.log(center)
        console.log(zoom)
    }

    onClick(event, latLng, pixel) {
       console.log(event)
       console.log(latLng)
       console.log(pixel)
    }



    render() {
        return(
            <div>
                <Navbar />

                <Map center={[50.879, 4.6997]} zoom={14} width={100} height={100}>
                <Marker anchor={[50.874, 4.6947]} payload={1} onClick={this.pixelToLatLng} />
                <button onClick={this.onClick}>Click me</button>

                <Overlay anchor={[50.879, 4.6997]} offset={[120, 79]}>
                </Overlay>
                </Map>
            </div>
        )
    }
}

export default PigeonMaps;
